🤱 BREASTFEEDING AWARENESS MONTH GIVEAWAY 🤱⁠⁠
⁠⁠
August is Breastfeeding Awareness Month, and to support all you breastfeeding mamas out there, we've partnered with incredible brands to support you along the way. One lucky mama will win all of these essentials perfect for their breastfeeding journey.⁠⁠
⁠⁠
How to enter:⁠⁠
❤️ Like this post⁠⁠
👍 Follow all 8 awesome brands tagged below⁠⁠
💬 Comment below and tell us what you love most about breastfeeding⁠⁠
🏷️ For an extra entry, tag an expecting or inspiring breastfeeding mama in the comments⁠⁠
⁠⁠
Winner will receive:⁠⁠
@nanobebe_world Breastfeeding Essentials like Breastmilk Bottles, Nursing Pads & Breastmilk Storage Bags, $150 value⁠⁠
@motherhoodmaternity Nursing Bras & Attire, $100 value⁠⁠
@spectrababyusa Synergy Dual Powered Electric Breast Pump, $325 value⁠⁠
@thelittlemilkbar_ Milk Maker and Other Empowering Breastfeeding Shirts, $100 value⁠⁠
@thebabychick 1:1 Virtual Lactation Support Meeting, $125 value⁠⁠
@motherloveherb Nipple Balm and Lactation Vitamins, $150 value⁠⁠
@milksnob Breastfeeding Covers and Blankets, $100 value⁠⁠
@lovemajka Bundle of Lactation Powder, Booster & Bites , $115 value⁠⁠
⁠⁠
Entries are being accepted on both Instagram and Facebook, so head over to FB for an extra chance to win! Giveaway ends 8/8 at 11:59 pm PST. Winner will be announced on 8/9. Must be 18 or older to enter. Open to US and CA residents. Giveaway not affiliated with Instagram.⁠⁠
⁠⁠
DISCLAIMER: We do NOT create separate giveaway accounts for contacting winners, nor do we ever ask giveaway winners for payment information for any reason ever.
